import React, { useState } from 'react';

function App() {
  const [count, setCount] = useState(0);
  const [stars, setStars] = useState('');

  const drawing = () => {
    console.log("click", count);

    let star = '';
    for(let i = 0; i < count; i++){
      star += '⭐️';
    }

    setStars(star);
    count++;
  }

  return (
    <>
      <button onClick={drawing}>{count}+</button>
    </>
  );
}

export default App;
